column53:
This Procurement is for the provision of an Appropriate Adult for Vulnerable Adults only in Cheshire. 

This Request for Quotation (RFQ) is a further competition under the YPO Framework Agreement 1015 (DPS) - Appropriate Adults. 

The proposed duration of the Contract will be a two [2] year initial term with the option to extend for a further three [3] 12mth periods. . The Contract will commence on October 1st 2023. 

It is the intention that the service provider will establish a fully managed Appropriate Adult Service for Vulnerable Adults to be delivered across Cheshire at the following Custody Suites in Runcorn, Middlewich & Blacon and various Designated Vulnerable Adult Suites. 

The below will be the minimum requirements of this service:
•	Guaranteed availability of AAs to attend every day between 0700-0000 hours; 
•	Guaranteed availability should an AA be required to attend beyond 0700-0000 hours, and it is expected that the AA will stay until the interview is complete;
•	Guaranteed availability of an AA via telephone 24 hours per day, 365/366 days per year;
•	24 hours per day, 365/366 days per year single point of contact for booking of AA services;
•	Robust management resources to ensure effective and efficient running of the service, rota management and to meet the reporting requirements of the Police and Crime Commissioner. 
•	Suitable, secure IT systems to accurately record requests for service and details of client contacts, and provide monthly contract monitoring and budgetary information, in line with a Service Level Agreement to be agreed between the provider and Police and Crime Commissioner upon provider appointment.
•	The Service Provider will ensure that an AA is provided to all Vulnerable Adults when requested by a member of Custody.
